        if(tus== ""){
          settus("style={{display : none}}")  
        }else if (tus=="style={{display : none}}"){
settus("")
        }
    }
    return (
        <div  className='header w-100 bg-primary justify-content-between'>
            <FormHeader stylee={tus} />
